(423, 'Surya -Khan-22-5-2019.html', '../dev/chatlogs/20190522/Kholik/Surya -Khan-22-5-2019.html', '2019-05-22', 'Kholik', '', '', '', '', '', '', '', '[[1558501909,\"s\",\"Selamat siang\"],[1558502177,\"c\",\"salam mas Yanuz\"],[1558502187,\"c\",\"saya punya domain : <A onclick=\'external.OnLinkClick(\\\"https:\\/\\/www.rumahhantu.club\\/\\\"); return false;\' href=\\\"https:\\/\\/www.rumahhantu.club\\/\\\">https:\\/\\/www.rumahhantu.club\\/<\\/A>\"],[1558502194,\"c\",\"kalau dalam perkembangannya kurang menjanjinkan contentnya, apakah rumah web menyediakan fasilitas ganti domain\"],[1558502299,\"s\",\"Kurang menjanjikannya itu seperti apa ya, Pak?\"],[1558502363,\"c\",\"maafkan kelabilan saya \"],[1558502385,\"c\",\"ya misal pengin beralih ke konten lain terus ganti nama domain\"],[1558502389,\"c\",\"Bagaimana cara mengganti Nameserver domain saya? Silahkan login ke ClientZone Rumahweb dan klik menu domain &gt; domainku. Didalamnya terdapat daftar domain yang Anda miliki. Pilih domainnya dan klik button manage domain. Anda akan masuk ke halaman pengelolaan domain yang dipilih dan didalamnya terdapat menu name server berisi form untuk perubahan nameserver. Saat melakukan pergantian name server, pastikan domain dalam keadaan unlock. Untuk unlock domain dilakukan dari menu registrar lock. Jika sudah selesai diubah name servernya bisa di enable kembali. Perlu diperhatikan bahwa perubahan nameserver baru akan menyebar di internet dalam waktu 6 - 48 jam tergantung pada refresh DNS resolver Anda. Tidak ada yang bisa dilakukan untuk mempercepatnya karena perubahan record NS memiliki standard waktu yang lebih lama dibandingkan perubahan DNS Zone.\"],[1558502434,\"c\",\"ini info yangb saya dapat dari knowledbase rumah web\"],[1558502450,\"c\",\"apakah bisa manual mandiri sewaktu-watu atau ada ketentuan khusus\"],[1558502454,\"c\",\"?\"],[1558502478,\"s\",\"Ini yang ingin diubah nama domain atau layanan hostingnya, Pak?\"],[1558502509,\"c\",\"nama domain\"],[1558502539,\"s\",