(468, 'teguh-23-5-2019.html', '../dev/chatlogs/20190523/Kholik/teguh-23-5-2019.html', '2019-05-23', 'Kholik', '[11:16:57]', 'teguh', 'teguh.otista@yahoo.com', 'Billing', 'tagihan', 'www.rumahweb.com', 'Default', '[[1558585029,\"s\",\"Selamat siang, ada yang bisa kami bantu ?\"],[1558585032,\"c\",\"selamat pagi\"],[1558585112,\"c\",\"untuk bayar tagihan\"],[1558585124,\"c\",\"Rumahweb Indonesia Dear teguh prasetyo (bagus penerjemah), Kami ingatkan bahwa Anda belum melakukan pembayaran untuk Invoice #1776685 yang akan jatuh tempo pada tanggal 14\\/05\\/2019. Berikut informasi detailnya : INVOICE #1776685 Jatuh Tempo: 14\\/05\\/2019 Domain Renewal - baguspenerjemah.com - 5 tahun (14\\/05\\/2019 - 13\\/05\\/2024) Rp 625.000,00 ------------------------------------------------------ Sub Total: Rp 625.000,00 10.00% PPN: Rp 62.500,00 Credit: Rp 0,00 Total: Rp 687.500,00 Detail invoice \\u00bb\\u00bb Untuk tagihan berlangganan, keterlambatan pembayaran dapat menyebabkan layanan Anda dihentikan\\/disuspend secara otomatis oleh sistem. Silahkan lakukan pembayaran sebelum jatuh tempo. TOTAL : Rp 687.500,00 Catatan: Untuk pembayaran yang sudah lewat tanggal jatuh tempo, mohon konfirmasikan terlebih dahulu ke Rumahweb agar dapat dicek apakah layanan masih dapat diaktifkan kembali atau tidak. Metode pembayaran: BCA BCA KCU Yogyakarta No. Rek. 0373607000 a\\/n CV Rumahweb Indonesia Klik disini untuk Membayar Lihat Daftar Rekening Konfirmasi Pembayaran Untuk pembayaran yang dilakukan dengan cara transfer via ATM Non-Tunai, Internet Banking, dan setoran tunai, silahkan cantumkan berita transfer sebagai berikut : INV 1776685\"],[1558585147,\"c\",\"apakah masih bisa diperpanjang\"],[1558585174,\"s\",\"Masih bisa, Pak\"],[1558585327,\"c\",\"baik terimakasih\"],[1558585340,\"c\",\"akan kami bayar hari ini, langsung bisa aktif ya\"],[1558585345,\"s\",\"Bisa, Pak\"],[1558585347,\"s\",\"Terima kasih kembali\"]]'),
