(531, 'Agus Yudi B-24-5-2019.html', '../dev/chatlogs/20190524/Aziz/Agus Yudi B-24-5-2019.html', '2019-05-24', 'Aziz', '[08.38.03]', 'Agus Yudi B', 'agus.brata@spm.sch.id', 'Billing', 'Selamat pagi saya sdh lunas bayar pskd-mandiri.sch,id Faktur Pajaknya kapan bisa saya terima? ', 'www.rumahweb.com', 'Default', '[[1558661901,\"s\",\"Selamat pagi, ada yang bisa saya bantu?\"],[1558662148,\"s\",\"Apakah bapak ingin menanyakan mengenai faktur untuk domain pskd-mandiri.sch.id?\"],[1558662190,\"c\",\"iya betul\"],[1558662209,\"c\",\"kapan ya bisa saya terima, krn dari Finance sdh menanyakan kesaya\"],[1558662229,\"s\",\"Kami cek untuk faktur pajak sudah diterbitkan dan sudah dikirimkan ke email terdaftar\"],[1558662243,\"c\",\"saya tunggu\"],[1558662317,\"s\",\"Untuk faktur telah kami kirimkan ke email kontak terdaftar yang diguakan untuk pendaftaran domain di Rumahweb\"],[1558662336,\"c\",\"ke email yg mana?\"],[1558662384,\"s\",\"Kami kirimkan ke email vicky.sanjaya@spm.sch.id pak\"],[1558662410,\"s\",\"Mungkin dapat menghubungi ke email terdaftar tersebut pak\"],[1558662455,\"c\",\"ohh email tsb sdh gak aktiv bu\"],[1558662462,\"c\",\"karena orangnya sudah resign\"],[1558662468,\"c\",\"pantesan saya gak terima2\"],[1558662502,\"c\",\"bisa diganti saja ke it.admin@spm.sch.id\"],[1558662533,\"c\",\"supaya disini kalau orgnya pd resign msh bisa kekirim ke email baru tsb\"],[1558662541,\"s\",\"Jika email kontak terdaftar sudah tidak aktif, mohon mengirimkan surat permohonan ganti kontak ke email billing@rumahweb.com\"],[1558662557,\"c\",\"email baru tsb akan forward ke semua IT yg masih aktif\"],[1558662611,\"s\",\"Untuk surat permohonan dapat dikirimkan melalui email it.admin@spm.sch.id supaya proses perubahan kontak dapat diproses lebih cepat\"],[1558662711,\"c\",\"sudah saya buatkan request pergantiannya via email\"],[1558662734,\"c\",\"utk FP nya apakah bisa dikirim lagi ke it.admin@spm.sch.id?\"],[1558662751,\"s\",\"Baik pak, bisa diinformasikan ID Ticket nya berapa?\