(559, 'jogjacityparking-24-5-2019.html', '../dev/chatlogs/20190524/Erlyana/jogjacityparking-24-5-2019.html', '2019-05-24', 'Erlyana', '', '', '', '', '', '', '', '[[1558685934,\"s\",\"Selamat siang \"],[1558685939,\"s\",\"Ada yang bisa kami bantu ?<BR>\"],[1558685967,\"c\",\"iya kami dari jogjaparking\"],[1558686034,\"s\",\"Mohon informasikan dahulu pembayarannya \"],[1558686041,\"c\",\"seperti yang saya jelaskan di atas bahwa pembayaran domain dengan invoice no 1663603 yang gagal di proses karena sudah expired. bagaimana untuk proses refundnya?\"],[1558686061,\"s\",\"apabila dana sudah diterima kami sarankan dana dimasukkan dahulu saja ke dalam deposit pada akun billing member area anda\"],[1558686076,\"s\",\"dimana dana deposit bisa digunakan kapan saja baik untuk order baru maupun perpanjangan \"],[1558686089,\"c\",\"lampiran pembayaran ada di tiket dengan nomor <A onclick=\'external.OnTicketLinkClick(\\\"WFX-196176\\\"); return false;\' href=\\\"https:\\/\\/support.srs-x.net\\/v1\\/staff\\/index.php?\\/Tickets\\/Ticket\\/View\\/WFX-196176\\\">WFX-196176<\\/A>\"],[1558686152,\"s\",\"baik pak, kami cek dahulu \"],[1558686160,\"c\",\"berarti dana tersebut tidak hangus dan bisa di gunakan sewaktu waktu? tetapi bagaimana saya mengakses dana tersebut? dan mengeceknya\"],[1558686172,\"s\",\"benar bapak\"],[1558686182,\"s\",\"mohon ditunggu kami cek dahulu emailnya \"],[1558686210,\"c\",\"baik bu\"],[1558686241,\"s\",\"Dana sudah diterima dan apabila bapak setuju maka kami akan segera memprosesnya \"],[1558686458,\"c\",\"di proses untuk pengaktifan domain?\"],[1558686507,\"s\",\"Bisa bapak\"],[1558686514,\"s\",\"Saat ini dana telah kami masukkan ke dalam deposit \"],[1558686533,\"s\",\"Jika bapak akan melakukan order baru domain maka biaya dapat menggunakan dana deposit tersebut \"],[1558686607,\"c\",\"itukan memang dana untuk mengaktifkan domain bu hanya saja domain kami belom aktif\"],[1558686683,\"s\",\"domain jogjaparking.com sudah jatuh tempo lama karena sudah lebih dari 30 hari maka status domain menjadi redemptionperiode\"],[1558686697,\"s\",\"dimana jika domain akan tetap diaktifkan maka melalui restore domain \"],[1558686703,\"c\",\"iya bu jadi dana tersebut masuknya ke deposit ya?\"],[1558686716,\"s\",\"alternatif lain menunggu domain available kembai \"],[1558686727,\"s\",\"*kembali \"],[1558686724,\"c\",\"kalau pesan domian itu berapa bu biayanya?\"],[1558686745,\"s\",\"kecuali bapak order domain baru menggunakan nama domain lain \"],[1558686755,\"s\",\"jika masih sama jogjaparking.com maka masih belum bisa didaftarkan \"],[1558686774,\"c\",\"kalau menunggu available kembali menunggu 90 hari ya bu? untuk biayanya berapa ya?\"],[1558686919,\"s\",\"benar bapak\"],[1558686928,\"s\",\"untuk biaya akan normal seperti biasa pak\"],[1558690742,\"s\",\"ada lagi yang bisa kami bantu ?\"],[1558690759,\"s\",\"Jika sudah tidak ada lagi pertanyaan, saya akan menutup sesi chat ini. Silahkan hubungi kami kembali jika ada pertanyaan lain mengenai produk dan layanan kami.<BR>Selamat beraktifitas kembali, terima kasih :)\"]]'),
