(591, 'dyan purnama-24-5-2019.html', '../dev/chatlogs/20190524/Ayu Muni/dyan purnama-24-5-2019.html', '2019-05-24', 'Ayu Muni', '[3:25:00 PM]', 'dyan purnama', 'design.indopeixin@gmail.com', 'Billing', 'saya sudah membayar tagihan untuk invoice #1794678. Mohon dicek ya. saya sudah konfirmasi pembayaran juga. ke cimb niaga rumah web indonesia. ', 'www.rumahweb.com', 'Default', '[[1558686325,\"s\",\"Selamat sore\"],[1558686338,\"s\",\"Mohon ditunggu kami cek dahulu\"],[1558686407,\"s\",\"Konfirmasi pembayaran sudah diterima\"],[1558686415,\"s\",\"Dan saat ini sedang dalam proses pengecekan dananya\"],[1558686424,\"s\",\"Jika sudah diproses akan diinformasikan di email kontak terdaftar\"]]'),
(592, 'Ferry-24-5-2019.html', '../dev/chatlogs/20190524/Ayu Muni/Ferry-24-5-2019.html', '2019-05-24', 'Ayu Muni', '[12:23:27 PM]', 'Ferry', 'andreasferry09@gmail.com', 'Technical Support', 'Cara membuat database phpmyadmin yang baru ( No Privileges ) melalui plesk. Apakah pengubahan priviledge ini merupakan wewenang server www.rumahweb.com?', 'www.rumahweb.com', 'Default', '[[1558675201,\"c\",\"oh. terima kasih infonya.\"],[1558675218,\"c\",\"kalau mau menambah database kena biaya berapa ya?\"],[1558675272,\"c\",\"kalau upgrade kena biaya berapa?\"],[1558675380,\"c\",\"ok. terima kasih\"],[1558674982,\"c\",\"Selamat siang. saya ingin menanyakan mengenai cara pembuatan database menggunakan plesk(wordpress). Saya mendapatkan access restrict yaitu No Priviledge saat ingin membuat database baru. apakah ini wewenang rumahweb.com?\"],[1558675074,\"c\",\"untuk pembuatan databasenya ya.\"],[1558675080,\"c\",\"www.mr-indobear.com\"],[1558675545,\"c\",\"Mau bertanya harga untuk meng-upgrade paket mr-indobear saat ini dan manfaat apa saja yang dapat diterima setelah mengupgrade paket tersebut\"],[1558675653,\"s\",\"Mohon ditungu kami cek dahulu\"],[1558676309,\"s\",\"Ingin diupgrade ke paket berapa pak?\"],[1558676400,\"c\",\"kalau menambah database pada phpmyadmin butuh paket apa?\"],[1558676426,\"s\",\"Sudah berkonsultasi dengan teknis Pak?\"],[1558676515,\"c\",\"pihak teknis bilang harus upgrade paket. tapi kurang tahu paket apa\"],[1558676564,\"s\",\"Atau mau kami sambungkan dulu ke teknis agar diinformasikan sebaiknya ke paket berapa untuk keubutuhan yang Bapak inginkan\"],[1558676677,\"c\",\"mau bertanya nama paket yang dibutuhkan untuk menambah database baru pada phpmyadmin.\"],[1558676779,\"c\",\"menambah 1 database untuk saat ini\"],[1558677067,\"c\",\"oh. tadi saya kira menambah database membutuhkan upgrade paket pula. terima kasih kalau begitu. lalu saya ingin menanyakan mengenai sub-domain. saya ingin mencoba masuk pada sub-domain yang baru saya buat namun berakhir dengan 404. Saya menggunakan framework CI yang dimasukkan pada folder sub domain. Apakah bisa dibantu memberi alasan mengapa hal ini terjadi?\"],[1558677226,\"c\",\"staff-only.mr-indobear.com\"],[1558677411,\"c\",\"ok. terima kasih\"]]'),
(593, 'Muslih Hasan-24-5-2019.html', '../dev/chatlogs/20190524/Ayu Muni/Muslih Hasan-24-5-2019.html', '2019-05-24', 'Ayu Muni', '[12:11:17 PM]', 'Muslih Hasan', 'cs.jambisite@gmail.com', 'Billing', 'Selamat siang', 'www.rumahweb.com', 'Default', '[[1558674681,\"s\",\"Selamat siang\"],[1558674802,\"c\",\"Mau tanya. Hosting JCNETWORK.TV udah expired. Bisa di perpanjang lagi gak?\"],[1558674833,\"s\",\"Mohon ditunggu kami cek dahulu\"],[1558674909,\"s\",\"Kami cek domain hosting jcnetwork.tv sudah jatuh tempo sejak tanggal 20\\/05\\/2019\"],[1558674923,\"s\",\"Dan Invoice perpanjangan telah terkiirim ke email kontak terdaftar\"],[1558674934,\"s\",\"Untuk saat ini invoicenya masih bisa dibayarkan sesuai dengan tagihannya\"],[1558674950,\"c\",\"Iya. Masih bisa ya. Ada diskon gak?\"],[1558675045,\"s\",\"Untuk saat ini belum ada pak\"],[1558675052,\"s\",\"Jadi sesuai tagihan Invoicenya\"],[1558675127,\"c\",\"Oh gitu. Biasa nya ada potongan untuk perpanjang hosting nya\"],[1558676846,\"s\",\"Sesuai tagihan invoicenya Pak\"]]'),
