(653, 'Yoga-27-5-2019.html', '../dev/chatlogs/20190527/Erlyana/Yoga-27-5-2019.html', '2019-05-27', 'Erlyana', '[2:11:04 PM]', 'Yoga', 'yoga@dimo.co.id', 'Billing', 'Selamat siang, Terkait dengan domain dimo.co.id, saya mendapatkan notifikasi kadaluarsa dalam 30 hari. Kami ingin melakukan perpanjangan, tetapi untuk melakukan pembayaran kami memerlukan invoice dan faktur pajak. Bagaimana supaya kami mendapatkannya? Tk', 'www.rumahweb.com', 'Default', '[[1558941096,\"s\",\"Selamat siang \"],[1558941101,\"s\",\"Ada yang bisa kami bantu ?\"],[1558941105,\"s\",\"Kami cek dahulu pak\"],[1558941313,\"s\",\"Normalnya invoice otomatis perpanjangan baru akan terbit pada H-14 sebelum jatuh tempo\"],[1558941318,\"c\",\"ok.\"],[1558941330,\"s\",\"Namun jika akan diterbitkan lebih awal maka kami akan mengirimkan invoicenya \"],[1558941343,\"s\",\"Rencana akan melakukan perpanjangan domain berapa tahun pak\"],[1558941351,\"c\",\"Oh ok. Artinya invoice akan terbit tanggal 11 Juni?\"],[1558941377,\"s\",\"Benar bapak\"],[1558941427,\"c\",\"untuk masa perpanjangan akan saya konfirmasi dulu dengan pihak finance. biaya per tahunya tetap 110rb atau berbeda kalau langsung jangka panjang?\"],[1558941654,\"s\",\"biaya per tahun 110.00 (belum termasuk ppn 10%)\"],[1558941665,\"s\",\"Kami tunggu konfirmasinya kembali pak\"],[1558941873,\"c\",\"Ok akan kami kabari kembali. Terima kasih!\"],[1558942291,\"s\",\"Baik pak, Terima kasih :)\"],[1558943419,\"s\",\"Ada lagi yang bisa kami bantu pak ?\"],[1558944647,\"s\",\"Jika sudah tidak ada lagi pertanyaan, saya akan menutup sesi chat ini. Silahkan hubungi kami kembali jika ada pertanyaan lain mengenai produk dan layanan kami.<BR>Selamat beraktifitas kembali, terima kasih :)\"]]'),
