(706, 'edy-27-5-2019.html', '../dev/chatlogs/20190527/Kholik/edy-27-5-2019.html', '2019-05-27', 'Kholik', '[14:39:10]', 'edy', 'edytantra@gmail.com', 'Billing', 'KEnapa invoice dan tagihan yg di charge ke creditcard itu lebih besar ya ??', 'www.rumahweb.com', 'Default', '[[1558942763,\"s\",\"Selamat siang, ada yang bisa kami bantu ?\"],[1558942777,\"c\",\"Your Question: KEnapa invoice dan tagihan yg di charge ke creditcard itu lebih besar ya ??\"],[1558942790,\"s\",\"Pembayaran melalui kartu kredit akan dikenai biaya tambahan untuk proses otomatisasinya, Pak\"],[1558942843,\"c\",\"kenapa tidak tercantum di invoice nya ?\"],[1558942849,\"c\",\"saya merasa ini tidak di informasikan di depan\"],[1558942877,\"s\",\"Karena biaya itu dari penyedia kartu kreditnya, Pak\"],[1558942889,\"s\",\"Kami tetap menerima sesuai tagihan di invoice\"],[1558942943,\"c\",\"loh itu mesti nya yg info dari pihak hosting dong. \"],[1558942953,\"c\",\"selama ini pakai credit card dimana2 gesek sesuai pemakaian\"],[1558942960,\"c\",\"mau offline maupun online shopping\"],[1558942979,\"c\",\"saya tau dari mana ini bukan di jadikan margin oleh rumah web\"],[1558942999,\"c\",\"dan kenapa ini tidak diinformasikan lebih awal ? saya berhak tau akan semua charges secara transparant, bukan ada hidden fee begini\"],[1558943155,\"s\",\"Karena ini bukan dari kami, Pak\"],[1558943164,\"s\",\"Tagihan ini dari penyedia layanan yang kami gunakan\"],[1558943172,\"c\",\"saya tau dari mana itu bukan dari rumahweb ?\"],[1558943185,\"c\",\"kenapa rumahweb tidak transparant stated jelas kl ada charges\"],[1558943192,\"s\",\"Kalo itu dari Rumahweb, pasti kami tambahkan di invoice, Pak\"],[1558943209,\"c\",\"jadi skrg gimana saya tau itu bukan dari rumahweb ? \"],[1558943227,\"c\",\"jadi sekarang saya mau reimburse kantor tidak match tagihan dan invoice gimana solusi nya ?\"],[1558943284,\"s\",\"Kalo tujuannya untuk reimburse, kami bisa menambahkan keterangan pada invoice bahwa ada biaya otomatisasi yang dikenakan oleh pihak penyedia layanan\"],[1558943301,\"s\",\"dengan besaran sekitar 3% dari tagihan di Rumahweb\"],[1558943308,\"c\",\"tolong angka nya semua di stated dengan jelas di invoice ya\"],[1558943333,\"s\",\"Kalo di invoice, kami hanya bisa memberikan keterangan seperti itu saja, Pak\"],[1558943335,\"c\",\"dan sekali lagi, rumahweb tidak transparant dengan membebankan fee charges ke pengguna tanpa sepengetahuan\"],[1558943340,\"s\",\"dan bukan pada rincian\"],[1558943355,\"s\",\"Selain itu, biaya ini bukan dari pihak kami\"],[1558943385,\"c\",\"mau dari mana pun itu, saya gesek utk bayar di rumahweb, dimana2 bayar 1rp yah di charge 1rp\"],[1558943405,\"c\",\"mana ada MDR di charge ke users kecuali di informasikan di awal\"],[1558944155,\"s\",\"Itu sudah kami informasikan, Pak\"],[1558944168,\"s\",\"Adanya fee tambahan pada saat sebelum melakukan pembayaran\"]]'),
