(826, '13Bambang-29-5-2019.html', '../dev/chatlogs/20190529/Dessi/13Bambang-29-5-2019.html', '2019-05-29', 'Dessi', '[14:52:14]', 'Bambang', 'bambkk@gmail.com', 'Billing', 'berapa outstanding bill gbilebakwangi.com', 'www.rumahweb.com', 'Default', '[[1559116341,\"c\",\"Siang mas Imam\"],[1559116352,\"s\",\"selamat siang\"],[1559116376,\"c\",\"Mhn info brp total tagihan gbilebakwangi.com\"],[1559116487,\"s\",\"saya cek dahulu pak\"],[1559116673,\"s\",\"untuk perpanjangan domain dan hosting sebesar Rp 808.500,-\"],[1559117103,\"c\",\"Itu berapa bulan ya mas?Krn sy sdg tugas keluar negeri jd gak sempat byr, status msh suspen \"],[1559117161,\"s\",\"maaf pak kami cek domain dan hostingnya statusnya aktif\"],[1559117180,\"s\",\"apakah yang di maksud layanan Website Builder Pro?\"],[1559117214,\"s\",\"untuk Website Builder Pro telah jatuh tempo pada tanggal 02\\/03\\/2019 dan statusnya suspend\"],[1559117628,\"s\",\"untuk Website Builder Pro harus di lakukan restore pak karena sudah jatuh tempo sejak bulan maret\"],[1559118317,\"s\",\"jika akan dilakukan restore biayanya sebesar Rp 400.400,- pak untukWebsite Builder Pro periode bulanan\"],[1559119236,\"c\",\"Loh kok ada biaya RESTORE ini maksudnya apa mas\"],[1559119261,\"s\",\"Website Builder Pro telah jatuh tempo pada tanggal 02\\/03\\/2019\"],[1559119290,\"s\",\"dan jika ingin di aktifkan kembali maka harus di restore setelah kami cek dari server\"],[1559119331,\"c\",\"sebelum2nya walau telat gak pernah saya di charge (gak ada biaya RESTORE)\"],[1559119419,\"c\",\"Domain kan saya bayar dimuka 1 THN \"],[1559119433,\"c\",\"Yang saya bayar bulanan adalah WEB HOSTING\"],[1559119515,\"s\",\"kami informasikan kembali pak untuk domain dan hosting unlimited S gbilebakwangi.com statusnya masih aktif sampai tanggal jatuh tempo 26\\/07\\/2019\"],[1559119558,\"s\",\"tetapi karena websitenya menggunakan layanan Website Builder Pro dan statusnya telah jatuh tempo sejak tanggal 02\\/03\\/2019 maka website tidak dapat di akses\"],[1559119667,\"s\",\"untuk layanan Website Builder Pro karena sudah terlambat lebih dari 30 hari sehingga jika ingin di aktifkan kembali hanya dapat dengan di restore .\"],[1559119695,\"c\",\"Betul mas, setiap saya terlambat AKAN OTOMATIS di blok (suspen) tetapi sblmnya saya tidak kena charge tambahan (RESTORE td) dan klo saya sdh bayar akan dibuka lagi \"],[1559119737,\"s\",\"jika keterlambatan kurang dari 30 hari tidak perlu melakukan restore pak\"],[1559119784,\"s\",\"sedangkan untuk layanan sudah jatuh tempo sejak bulan maret dan saat ini sudah 2 bulan keterlambatannya pak\"],[1559119793,\"c\",\"satu lagi mas.... Hal itu pun TIDAK DIINFORMASIKAN kepada saya lho sejak 02\\/03\\/2019 - gak ada woro2 sama sekali dari rumahweb.com \"],[1559119830,\"s\",\"untuk invoice sudah kami kirimkan sejak tanggal 16\\/02\\/2019 pak ke email kontak yang terdaftar\"],[1559120034,\"c\",\"Iya invoice sdh dikirim... maksud saya akan ada CHARGE TAMBAHAN ini Gak pernah disampaikan (warning) sebelumnya\"],[1559120119,\"s\",\"saat ini layanan di serve sudah tercancel pak sehingga hanya dapat di proses restore \"],[1559120135,\"c\",\"Saya akan bayar tunggakan saya sebesar Rp 808.500,- saja dan website saya diaktifkan lagi\"],[1559120178,\"s\",\"808.500,- ini adalah biaya perpanjangan domain dan hosting periode 2019-2020 pak berbeda dengan layanan website builder pro\"],[1559120188,\"c\",\"Loh klo ada CANCEL atau PEMBERHENTIAN kan gak bisa SEPIHAK BEGITU mas.... harus kasih tau saya dong\"],[1559120220,\"c\",\"Boleh saya minta sebesar Rp 808.500,- dibreakdown apa saja?\"],[1559120322,\"c\",\"Karena bukan salah saya saja mas: Dari awal saya minta baik2 supaya tagihan dibuat otomatis ke credit card saya spy gak telat2 tapi katanya gak bisa .... \"],[1559120361,\"c\",\"ada proses PEMEBRHENTIAN kok saya gak dikasih tau.... SEDIH BGT cara kerjanya\"],[1559120377,\"s\",\"untuk biaya 808.500 adalah biaya perpanjangan hosting unlimited S periode 1 tahun Rp 660.000+ biaya perpanjangan domain gbilebakwangi.com 148500\"],[1559120414,\"s\",\"untuk tagihan rumahweb memang tidak dapat otomatis tertagih ke creditcard pak\"],[1559120454,\"c\",\"Memang periode gbilebakwangi.com - 2018-2019 berakhir bulan apa mas? - nanti saya cocok kan dg catatan saya \"],[1559120496,\"s\",\"untuk domain dan hosting expiredya pada tanggal 26\\/07\\/2019 \"],[1559120931,\"s\",\"selain invoice kami juga telah mengirimkan notifikasi suspend pada tanggal 02\\/03\\/2019\"],[1559120946,\"c\",\"Nah kalo masih expiredya pada tanggal 26\\/07\\/2019 ==&gt; Kok saya sdh ditagih mas\"],[1559121048,\"s\",\"sebelumnya bapak cuma menginformasikan nama domain dan tidak layanan yang akan di perpanjang sehingga saya menginformasikan biaya perpanjangan domain dan hosting \"],[1559121069,\"c\",\"Saya bayar OUTSTANDING BILLING saya ya mas harusnya (logika berhitung saya) ==&gt; 152,900 X 3 (Mei) = 458,700 - website saya aktif (done)\"],[1559121089,\"s\",\"mohon di cek email notifikasi suspendnya pak\"],[1559121101,\"s\",\"di sana sudah di jelaskan\"],[1559121106,\"c\",\"Nanti Juli boleh diktagihkan yg perpanjangan DOMAIN sblm tanggal 26\\/07\\/2019\"],[1559121112,\"s\",\"JIKA layanan yang Anda gunakan terhenti karena alasan billing, layanan dapat langsung aktif kembali setelah kami menerima pembayaran Anda dalam rentang 14 hari. Setelah itu besar kemungkinan layanan Anda telah kami terminate dan jika ada data yang tersimpan didalamnya akan terhapus. Kami akan mengenakan biaya restore apabila Anda mengaktifkan kembali layanan dalam waktu lebih dari 14 hari setelah tersuspend.\"],[1559121241,\"s\",\"saya hanya menjalankan prosedur yang ada pak \"],[1559121308,\"c\",\"Okay mas saya ngerti - jd saran mas Imam apa spy website saya aktif kembali\"],[1559121354,\"c\",\"Tp utk bayar DOMAIN sy gak setuju kan blm EXPIRED \"],[1559121376,\"c\",\"masih 2 bulan lagi \"],[1559121402,\"s\",\"untuk restore website builder pro sebesar Rp 400.400,-\"],[1559121434,\"s\",\"untuk perpanjangan domain dan hosting tidak perlu di b