ana yang sesuai, mohon ditunggu sebentar\"],[1559207478,\"c\",\"saya mau upgrade pak untukk menghilangkan footer dan menambah jumlah produk pada plugin products saya harus upgrade ke paket mana pak ? \"],[1559207615,\"c\",\"iya benar pak\"],[1559207774,\"c\",\"kalau untuk product pak ?\"],[1559207791,\"c\",\"apakah paket di atas sudah termasuk favicon juga ?\"],[1559208177,\"c\",\"kalo untuk product pak ?\"],[1559208949,\"c\",\"untuk paketnya saya harus upgrade ke yang mana pak ?\"],[1559208962,\"c\",\"dan apa keunggulan masing masing paketnya ?\"],[1559209662,\"s\",\"Untuk upgrade paketnya bisa disesuaikan dengan kebutuhan website Pak Andreas\"],[1559209692,\"s\",\"Keunggulan ataupun detail masing-masing paket bisa dilihat di website kami, <A onclick=\'external.OnLinkClick(\\\"https:\\/\\/www.rumahweb.com\\/jasa-pembuatan-website\\/\\\"); return false;\' href=\\\"https:\\/\\/www.rumahweb.com\\/jasa-pembuatan-website\\/\\\">https:\\/\\/www.rumahweb.com\\/jasa-pembuatan-website\\/<\\/A>\"],[1559209751,\"c\",\"untuk semua paket bisa rmove footer dan menambah favicon ? \"],[1559210108,\"s\",\"Iya bisa\"],[1559210199,\"c\",\"okey saya upgrade \"]]'),
