(963, 'slamet suyono-31-5-2019.html', '../dev/chatlogs/20190531/Ayu Muni/slamet suyono-31-5-2019.html', '2019-05-31', 'Ayu Muni', '[1:51:20 PM]', 'slamet suyono', 'slametklepon@gmail.com', 'Technical Support', 'hallo mas ', 'www.rumahweb.com', 'Default', '[[1559274794,\"c\",\"mau tanya, bagaimana cara memindahkan domain ke hosting sy yg baru ?\"],[1559275439,\"c\",\"banyak mas, ada 7 kalau ga salah. semua yg ada di paketan hosting sy yg khatulistiwamall.com \"],[1559275541,\"c\",\"khatulistiwamall.com ; jasamadiun.com ; kampusreseller.com ; jadisupplier.com ; pincuk.com ; rumahtool.com ; slametklepon.com\"],[1559275824,\"c\",\"iya mas, tetap di rumah web juga\"],[1559276723,\"c\",\"oke\"],[1559277740,\"c\",\"ok\"],[1559281169,\"c\",\"mas, bisa melihatkan hosting sy pakai berapa cloud power yg domainnya khatulistiwamall.com ?\"],[1559282618,\"c\",\"hallo mas, apakah sudah pulang dari sholat jumat?\"],[1559283313,\"c\",\"halo\"],[1559284916,\"c\",\"oowww,, pantesan beda,,, hahaha\"],[1559284922,\"c\",\"itu ram 4 gb ya mas\"],[1559285051,\"c\",\"ak tadi kan barusan beli mas , ga tau kalau ada yg 3 cloud. baru tau ini kalau yg ak beli ternyata yg grow. baru beli hari ini\"],[1559285070,\"c\",\"pengennya ak yg bloom itu sebenere mas. \"],[1559285083,\"c\",\"cepet kalau yg itu\"],[1559285097,\"c\",\"kalau yg grow itu ram nya cuma 2 gb ya mas ?\"],[1559285219,\"c\",\"waduh,, gimana nih. kalau mau ganti yg bloom bisa ga mas ? baru tadi ak belinya. baru nge cek ternyata salah order ak. \"],[1559285296,\"c\",\"domainnya khatulistiwadigital.com\"],[1559285401,\"c\",\"ya mas, bisa ya\"],[1559285522,\"s\",\"Selamat siang\"],[1559285530,\"c\",\"siang\"],[1559285578,\"s\",\"Ingin upgrade ya Pak?\"],[1559285587,\"c\",\"mbak, sy pengen pindah layanan dari paket grow ke bloom, tadi keliru pilih\"],[1559285591,\"c\",\"ya mbak\"],[1559285630,\"s\",\"Untuk domain khatulistiwadigital.com ya Pak?\"],[1559285648,\"c\",\"iya mbak \"],[1559285673,\"s\",\"Untuk upgradenya nanti akan dikenakan biaya sebesar Rp 660.000 sudah dengan PPn Pak\"],[1559285743,\"c\",\"tadi kan sudah bayar paket grow mbak , bukan tinggal nambah saja ya?\"],[1559285776,\"s\",\"Iya kalo upgrade memang dihitung proparata Pak\"],[1559285785,\"s\",\"Mengingat paket hostingnya sudah aktif\"],[1559285821,\"c\",\"lhoh, baru tadi pagi itu lo mbak. domainnya juga blm sy aktifkan\"],[1559285829,\"c\",\"belum kepakai sama sekali\"],[1559285834,\"c\",\"baru berapa jam\"],[1559285890,\"s\",\"Iya Pak, tapi layanannya sudah aktif sehingga dihitungnya prorata\"],[1559285897,\"s\",\"Paket lama ke paket yang baru\"],[1559285981,\"c\",\"seharusnya kan selisih harganya 120.000 mbak. kalau 660.000 itu kan sama saja sy beli baru\"],[1559286053,\"s\",\"Kalo upgrade tidak menggunakan harga promo pak \"],[1559286121,\"c\",\"masak keliru pilih gitu aja ga bisa di rubah sih mbak ? seharusnya itu bukan masuk kategori upgrade mbak. tapi keliru beli. dan lagian dipakai aja belum. juga masih di hari yg sama, masak ga bisa sih mbak\"],[1559286190,\"s\",\"Iya Pak mohon maaf jika ingin menggunakan paket unlimited bloom dihitung dengan biaya upgrade prorata dari paket lama ke paket baru\"],[1559286299,\"c\",\"haduhh kok gitu ya,,, (ini ak ga marah lho ya mbak, tapi kecewa, hehehe)\"],[1559286406,\"c\",\"padahal ak bela2 in pakai hosting rumah web punya orang negri sendiri daripada hosting luar,, heehehehehe,,, ternyata saya kecewa,,,, sedikit. hehehe ga pa2 ya mbak, sy utarakan\"],[1559286463,\"s\",\"Iya Pak memang prosedurnya demikian jadi tetap dihitung prorata dengan harga normal bukan harga promo\"],[1559286458,\"c\",\"ga ada solusi lain mbak ? \"],[1559286914,\"c\",\"yaudah lah kalau gitu mbak. sy ga nyalahin mbak. tapi tolong sampein aja ke bos nya, bahwa ada pelanggan yg bela2in pilih hosting negeri sendiri dirumahweb yg kecewa dg sistem prosedurnya. tlng sampein ya mbak. saya tunggu sampai besok barangkali ada pengecualian dari bosnya untuk sy mbak (hehe,ngarep). kalau ga ada , ya udah ga pa2. goodbey. hehehe. \"],[1559287052,\"c\",\"semua domain juga sy beli disini padahal,,, ada 8 domain,,, hhhhaahhhh\"],[1559287131,\"c\",\"baik mbak, kalau ga ada lagi yg bisa disampaikan yaudah, terimakasih, silahkan ditutup chat nya,, hehehe\"],[1559287209,\"s\",\"Iya Pak mohon maaf \"]]'),
