(1082, 'Nabil-2-6-2019.html', '../dev/chatlogs/20190602/Kholik/Nabil-2-6-2019.html', '2019-06-02', 'Kholik', '', '', '', '', '', '', '', '[[1559474956,\"c\",\"jadi gmn ya solusinya?? kami takut si pencuri mengambil source code yg ada di dlm server..\"],[1559474992,\"c\",\"atau bisa request langkah pencegahan?? dgn menghapus smua data, baik website &amp; database ny??\"],[1559475017,\"c\",\"kami sudah punya backup ny, hanya saja kami takut jika jatuh ke tangan org..\"],[1559475200,\"c\",\"masalahnya email pardosi16@gmail.com sudah tdk bisa lagi diakses, hape pemilik website hilang dan email ny diambil, saya disini hanya sebagai perwakilan developer yg bertanggung jawab atas isi hosting..\"],[1559475247,\"c\",\"password di client area jg sudah diubah..\"],[1559475339,\"c\",\"kami sudah tdk bisa lagi mengakses akun clientarea. satu-satu ny yg tertinggal ya email saya itu yg masi jd email cadangan di clientarea, karna bbrapa hari yg lalu saya masi dapat pemberitahuan dr hosting, ad yg mengakses..\"],[1559475389,\"c\",\"hape pemilik website hilang, semua ny, email ny, nomor telp ny, jadi gk ad lg akses ke email..\"],[1559475556,\"c\",\"oke..\"],[1559475573,\"s\",\"Selamat malam\"],[1559475896,\"c\",\"malam, kira kira gmn ya solusi masalah kami?\"],[1559475936,\"s\",\"Apakah pemilik sebelumnya juga lupa kata sandi akun Rumahweb miliknya?\"],[1559475978,\"s\",\"Apabila masih, kami sarankan untuk menambahkan email lain sebagai sub akun terlebih dahulu\"],[1559475997,\"s\",\"kemudian mengajukan penggantian alamat email akun utama melalui email sub akun tersebut\"],[1559476676,\"c\",\"pemilik akun tidak lupa dgn password ny, tapi masalah ny password clientarea sudah diganti oleh org yg mengambil HP, trmasuk di HP trsebut email pemilik yg jg sudah diganti password ny..\"],[1559476768,\"c\",\"jd kami disini benar\\\" blank, gk punya akses, baik ke clientarea, ataupun ke email pemilik website..\"],[1559476814,\"s\",\"Apakah pemegang akun yang sekarang masih dapat dihubungi ?\"],[1559476819,\"c\",\"yg kami dapat hanya notif ke email saya ttg aktivitas akun, karna email saya masih trhubung ke clientarea sbg subemail..\"],[1559476865,\"c\",\"masih, tapi smua akun email, no HP, sudah diganti dgn yg baru..\"],[1559476956,\"s\",\"Jika masih, silakan menghubungi pemegang akun terlebih dahulu agar mendapat akses, atau Ibu dapat mengirimkan request pemulihan melalui email ke billing@rumahweb.com\"],[1559476991,\"c\",\"ini pemilik ada bersama saya..\"],[1559477064,\"s\",\"Baik, silakan mengirimkan email request terkait penambahan email sub account dengan menggunakan email kontak saat ini terlebih dahulu Bu\"],[1559477075,\"s\",\"Ke email billing@rumahweb.com\"],[1559477145,\"c\",\"nah, ini email ny dulu sudah pernah ditambahkan di akun clientarea pemilik website, ini email ny : dominictoretto52@gmail.com\"],[1559477161,\"c\",\"jd apa yg harus saya laporkan ke email billing@rumahweb.com\"],[1559477164,\"c\",\"??\"],[1559477290,\"s\",\"Silakan mengirimkan request untuk penggantian main account atau penambahan aksesnya\"],[1559477368,\"s\",\"Kami cek saat ini alamat email tersebut belum terdaftar sebagai email sub kontak\"],[1559477443,\"c\",\"dulu pernah ditambahkan, dan saya masih dapat email notif aktivitas hosting di email saya..\"],[1559477451,\"c\",\"sebentar saya screeshot..\"],[1559477855,\"c\",\"<A onclick=\'external.OnLinkClick(\\\"http:\\/\\/images2.imagebam.com\\/c8\\/75\\/ae\\/4da7b91239693794.png\\\"); return false;\' href=\\\"http:\\/\\/images2.imagebam.com\\/c8\\/75\\/ae\\/4da7b91239693794.png\\\">http:\\/\\/images2.imagebam.com\\/c8\\/75\\/ae\\/4da7b91239693794.png<\\/A>\"],[1559477867,\"c\",\"<A onclick=\'external.OnLinkClick(\\\"http:\\/\\/images2.imagebam.com\\/36\\/f5\\/ca\\/04a8301239693824.png\\\"); return false;\' href=\\\"http:\\/\\/images2.imagebam.com\\/36\\/f5\\/ca\\/04a8301239693824.png\\\">http:\\/\\/images2.imagebam.com\\/36\\/f5\\/ca\\/04a8301239693824.png<\\/A>\"],[1559477954,\"s\",\"Bukan itu yang dimaksud, Pak\"],[1559477962,\"s\",\"Kalo itu tidak berhubungan dengan akun Rumahweb\"],[1559477975,\"s\",\"Namun berhubungan dengan cPanel hosting yang digunakan\"],[1559478227,\"s\",\"Apabila pemilik masih bisa masuk ke akun Rumahwebnya, silakan tambahkan email baru sebagai sub akun terlebih dahulu\"],[1559478235,\"s\",\"dengan mengikuti panduan berikut\"],[1559478235,\"s\",\"<A onclick=\'external.OnLinkClick(\\\"https:\\/\\/www.rumahweb.com\\/journal\\/cara-menambah-sub-contactssub-accounts\\/\\\"); return false;\' href=\\\"https:\\/\\/www.rumahweb.com\\/journal\\/cara-menambah-sub-contactssub-accounts\\/\\\">https:\\/\\/www.rumahweb.com\\/journal\\/cara-menambah-sub-contactssub-accounts\\/<\\/A>\"],[1559478294,\"c\",\"min, pemilik sudah tidak bisa lagi masuk kedalam akun rumahweb ny..\"],[1559478304,\"c\",\"karna HP ny hilang..\"],[1559478344,\"c\",\"smua akun, baik rumahweb, email, sosmed, smua ny tidak bisa diakses lg, kemungkinan sudah diambil alih org yg nemu HP ny..\"],[1559478414,\"c\",\"dan jika memang kami tidak bisa lg mengganti email utama, ada solusi lain?? kami hanya butuh akses ke cpanel, utk menghapus smua hasil kerjaan kami, agar tidak disalahgunakan..\"],[1559478459,\"s\",\"Sudah dicoba untuk mengakses cPanel sesuai dengan nama pengguna dan kata sandi sebelumnya, Pak?\"],[1559478477,\"c\",\"sudah, tapi tidak berhasil..\"],[1559478500,\"c\",\"username : cark1258 password : Regus999\"],[1559478520,\"c\",\"itu password terakhir yg kami tau..\"],[1559478658,\"s\",\"Kami periksa cPanelnya tidak pernah menggunakan kata sandi Regus999, Pak\"],[1559478819,\"c\",\"lah, itu password terakhir yg kami gunakan selama ini, memang hosting ny sbelum ny pernah mati karna tidak diperpanjang..\"],[1559478848,\"c\",\"tapi domain ny masi aktif, jd bbrapa hari belakangan ini diaktifkan kembali hosting ny..\"],[1559478953,\"c\",\"<A onclick=\'external.OnLinkClick(\\\"http:\\/\\/images2.imagebam.com\\/b8\\/49\\/c0\\/6b72ff1239707624.png\\\"); return false;\' href=\\\"http:\\/\\/images2.imagebam.com\\/b8\\/49\\/c0\\/6b72ff1239707624.png\\\">http:\\/\\/images2.imagebam.com\\/b8\\/49\\/c0\\/6b72ff1239707624.png<\\/A>\"],[1559478976,\"c\",\"itu buktinya, bahkan password mysql ny jg itu..\"],[1559479074,\"s\",\"Oh begitu, Pak\"],[1559479092,\"s\",\"Silakan sampaikan kendala ini melalui email ke billing@rumahweb.com saja, Pak\"],[1559479169,\"c\",\"oke, terima kasih banyak utk info &amp; saran ny..\"],[1559479211,\"s\",\"Terima kasih kembali, Pak\"]]'),
