ening kami yang selain BNI\"],[1560137126,\"c\",\"aduuhhh\"],[1560137153,\"s\",\"Untuk daftar rekening kami bapak dapat melihatnya di <A onclick=\'external.OnLinkClick(\\\"https:\\/\\/www.rumahweb.com\\/pembayaran\\/\\\"); return false;\' href=\\\"https:\\/\\/www.rumahweb.com\\/pembayaran\\/\\\">https:\\/\\/www.rumahweb.com\\/pembayaran\\/<\\/A>\"],[1560137156,\"c\",\"seandainya dipindah ke BCA atau Mandiri apakah bisa ?\"],[1560137167,\"s\",\"Untuk BCA dan Mandiri bisa bapak\"],[1560137231,\"c\",\"trus invoice yang sudah trlanjur pilih BNI gmn ?\"],[1560137268,\"s\",\"Bapak hanya perlu mengubahnya melaui member area clientzone.rumahweb.com saja pak\"],[1560137282,\"c\",\"baik saya coba\"],[1560137342,\"c\",\"maaf saya baru pke rumah web, bisa dibantu caranya ?\"],[1560137408,\"s\",\"Pertama-tama, silakan bapak login ke <A onclick=\'external.OnLinkClick(\\\"https:\\/\\/clientzone.rumahweb.com\\\"); return false;\' href=\\\"https:\\/\\/clientzone.rumahweb.com\\\">https:\\/\\/clientzone.rumahweb.com<\\/A> terlebih dahulu\"],[1560137450,\"s\",\"Kemudian, bapak masuk ke menu Billing - My Invoices\"],[1560137492,\"s\",\"Lalu pilih dengan mengklik invoice 1814823\"],[1560137572,\"c\",\"kmudian pilih metode pembayaran ya ?\"],[1560137583,\"s\",\"Iya betul bapak\"],[1560137636,\"s\",\"Kemudian bapak bisa langsung melakukan pembayarannya dengan mengklik tombol di bawah status \\\"UNPAID\\\"\"],[1560137793,\"c\",\"sudah saya bayar barusan pke VA BCA mbak,\"],[1560137804,\"c\",\"145.280\"],[1560137859,\"c\",\"Alhmdlh ternyata statusnya sudah PAID\"],[1560137867,\"s\",\"Baik bapak, dana sudah kami terima\"],[1560137883,\"s\",\"Terima kasih bapak atas pembayarannya\"],[1560137891,\"s\",\"Apakah ada hal lain yang dapat kami bantu?\"],[1560137911,\"c\",\"utk tnya2 Cpanel saya hrus ganti chat ke teknical support ya ?\"],[1560137946,\"s\",\"Iya betul bapak, bapak dapat chat langsung ke Technical Supportnya, apakah perlu saya sambungkan bapak?\"],[1560137964,\"c\",\"boleh\"],[1560138089,\"c\",\"untuk akses ke cpnel atau sejenisnya gmna caranya mas ?\"],[1560138106,\"c\",\"maaf saya msih bru pke rumah web\"],[1560138110,\"c\",\"tlg dibantu\"],[1560138222,\"c\",\"andik.id\"],[1560138362,\"c\",\"baik akan saya coba, trimakasih\"],[1560139598,\"c\",\"mas, saya sdh coba aktifkan SSL tapi ttp saja gambar gembok nya masih warna merah, bisa dibantu ?\"],[1560140245,\"c\",\"ok gemboknya sdh warna hijau, trimaksih\"],[1560140849,\"c\",\"1 lagi mas, free SSL nya (gembok hijau) berlaku seterusnya atau bagaimana mas ?\"]]'),
