(1182, 'Edwardson Edo-10-6-2019.html', '../dev/chatlogs/20190610/Aziz/Edwardson Edo-10-6-2019.html', '2019-06-10', 'Aziz', '[10.43.15]', '+62081291005100', 'edwardson.edo@gmail.com', 'Billing', 'Selamat pagi', 'Hosting.ID', 'Default', '[[1560138193,\"c\",\",selamat pagi\"],[1560138202,\"s\",\"Selamat pagi, apakah ada yang bisa kami bantu?\"],[1560138251,\"c\",\"Mba,tempo hari saya dikirimin ke email tagihan perpanjangan hosting agensembako.net\"],[1560138257,\"c\",\"Dan biaya restore\"],[1560138268,\"c\",\"Serta biaya pembelian domain warung semb\"],[1560138276,\"c\",\"Warungsembako.net\"],[1560138285,\"c\",\"Cuma pas saya mau chat off line semua\"],[1560138297,\"c\",\"Kalau mau bayar skg bagaimana mba?\"],[1560138423,\"s\",\"Baik bapak, kami akan lakukan pengecekan terlebih dahulu terkait tagihan untuk perpanjang hosting agensembako.net ya pak\"],[1560138517,\"c\",\"Ok\"],[1560138638,\"c\",\"Sudah mba?\"],[1560138727,\"c\",\"Untuk pembelian domain warungsembako.net dan biaya restore hosting agensembako.net nya bagaimana mba?\"],[1560138860,\"c\",\"Mana jawabanny mba???\"],[1560138935,\"s\",\"Baik bapak mohon maaf telah menunggu sedikit lama, setelah kami lakukan pengecekan, untuk invoice perpanjangan hosting dan order domain warungsembako.net masih bisa dilakukan pembayarannya pak\"],[1560138954,\"s\",\"Dengan biaya yang tertera pada masing-masing invoicenya\"],[1560139001,\"c\",\"Ok mba\"],[1560139006,\"c\",\"Saya ke ATM skg\"],[1560139013,\"c\",\"Buat konfirmasi bagaimana mba??\"],[1560139042,\"s\",\"Silakan bapak konfirmasi kembali dengan menyertakan bukti pembayaran melalui web <A onclick=\'external.OnLinkClick(\\\"https:\\/\\/ipg.rumahweb.com\\/konfirmasi\\/,\\\"); return false;\' href=\\\"https:\\/\\/ipg.rumahweb.com\\/konfirmasi\\/,\\\">https:\\/\\/ipg.rumahweb.com\\/konfirmasi\\/,<\\/A> atau dapat Anda kirimkan ke email billing@rumahweb.com\"],[1560139050,\"s\",\"Terima kasih bapak\"],[1560139057,\"s\",\"Apakah ada hal lain yang dapat kami bantu?\"],[1560139075,\"c\",\"Lalu,setelah pembayaran ,apakah kami bisa minta tolong hosting.id utk men-direct domain warungsembako.net ke agensembako.net??\"],[1560139099,\"c\",\"Tempo hari katanya boleh,kalau kami bayar sih,caranya minta tolong nya bagaimana \"],[1560139108,\"s\",\"Bisa bapak, rekan dari Teknis kami dapat membantu bapak\"],[1560139146,\"s\",\"Bapak dapat melakukan request melalui chat ke divisi technical support, atau melalui email teknis@rumahweb.com\"]]'),
