(1185, 'Jaji Suraji-10-6-2019.html', '../dev/chatlogs/20190610/Aziz/Jaji Suraji-10-6-2019.html', '2019-06-10', 'Aziz', '[11.10.32]', 'Jaji Suraji', 'jaji.satira@gmail.com', 'Sales', '<I>none supplied</I>', 'www.rumahweb.com', 'Default', '[[1560139715,\"c\",\"Slmt siang mas Dilan, saya mau konfirmasi pembayaran biling saya untuk uhsbandung.com. baru saja 30 menit lalu melalui BNI Rumah WEB, karena saya baru baca via sms, bahwa uhsbandung.com sudah suspend. mohon dihidupkan lagi ya...\"],[1560139779,\"c\",\"dari rekening : jaji Suraji Satira sebesar 606.507 ,- angka 7 sebagai angka unik\"],[1560139851,\"s\",\"Selamat siang, apakah ada yang bisa kami bantu?\"],[1560139868,\"c\",\"apakah ini dengan staf billing ?\"],[1560139874,\"s\",\"Iya betul bapak\"],[1560139892,\"s\",\"Bisa diinformasikan untuk InvoiceIDnya pak?\"],[1560139964,\"c\",\"Mbak Azkia, saya untuk an. uhsbandung.com 30 menit lalu transfer untuk billing perpanjangan 1 tahun kedepan : dari rekening. : an. jaji Suraji Satira sebesar : 606.507..... angka (7) sebagai angka unik untuk mempermudah...... \"],[1560140023,\"c\",\"uhsbandung.com suspend hari ini, saya baru ngeh info melalui sms tadi...... terima kasih atas bantuannya agar uhsbandung.com bisa hidup lagi..... salam.\"],[1560140056,\"c\",\"saya transfer melalui BNI Rumah Web.\"],[1560140096,\"c\",\"invoice no. 1796313\"],[1560140136,\"s\",\"Baik bapak, konfirmasi pembayaran sudah kami terima dan akan segera diverifikasi oleh petugas billing kami\"],[1560140139,\"s\",\"Untuk melihat status konfirmasi, silahkan masukkan kode konfirmasi \\\"BFN-6360\\\" di halaman <A onclick=\'external.OnLinkClick(\\\"https:\\/\\/ipg.rumahweb.com\\/konfirmasi\\/check\\/\\\"); return false;\' href=\\\"https:\\/\\/ipg.rumahweb.com\\/konfirmasi\\/check\\/\\\">https:\\/\\/ipg.rumahweb.com\\/konfirmasi\\/check\\/<\\/A>\"],[1560140201,\"c\",\"baik mbak terima kasih.......\"],[1560140204,\"s\",\"Pembayaran sudah kami terima ya bapak, saat ini sudah masuk ke dalam antrian untuk perpanjangannya\"],[1560140214,\"s\",\"Apakah ada hal lain yang dapat kami bantu bapak?\"],[1560140255,\"c\",\"cukup mbak jika sudah masuk daftar perpanjangan, soalnya saya baru tahu hari ini sudah suspend\"],[1560140310,\"c\",\"nanti saya kontak lagi mbak ya....... tks. dan salam. minal aidzin maaf lahir batin untuk semua krew nya ya.....\"],[1560140340,\"c\",\"maaf lahir dan batin.\"],[1560140365,\"s\",\"Terima kasih kembali bapak, senang dapat membantu bapak\"],[1560140370,\"s\",\"Kami juga mengucapkan minal aidin wal faidzin, mohon maaf lahir dan batin ya bapak\"]]'),
(1186, 'Jasin Sowandi-10-6-2019.html', '../dev/chatlogs/20190610/Aziz/Jasin Sowandi-10-6-2019.html', '2019-06-10', 'Aziz', '[11.05.14]', 'Jasin Sowandi', 'jasinsowandi@gmail.com', 'Billing', 'saya telah melakukan pembayaran untuk invoice nomor #1814836. tetapi status invoice saya masih unpaid. Saya menggunakan VA BNI dengan No VA:8189317460122556 a.n. mitra-automation.id', 'www.rumahweb.com', 'Default', '[[1560139525,\"s\",\"Selamat siang, apakah ada yang bisa kami bantu?\"],[1560139565,\"c\",\"saya telah melakukan pembayaran untuk invoice nomor #1814836. tetapi status invoice saya masih unpaid. Saya menggunakan VA BNI dengan No VA:8189317460122556 a.n. mitra-automation.id\"],[1560139679,\"s\",\"Baik bapak, kami akan coba lakukan pengecekan terlebih dahulu bapak\"],[1560139680,\"s\",\"Karena sejak pagi tadi BNI tidak dapat kami akses\"],[1560139714,\"c\",\"betul bu, tapi barusan saya coba udah bisa melakukan pembayaran..\"],[1560139827,\"s\",\"Baik pak, saat ini pembayaran Anda sudah masuk dalam proses namun belum sukses\"],[1560139828,\"s\",\"Silakan Anda tunggu saja bapak, apabila pembayaran dari penyedia VA sudah sukses, maka domain akan langsung aktif\"],[1560139924,\"c\",\"Ok bu... perlu saya kirimkan bukti transfernya?\"],[1560140025,\"s\",\"Boleh bapak sebagai bukti penunjang, silakan bapak kirimkan bukti pembayaran ke email billing@rumahweb.com\"],[1560140501,\"c\",\"Saya sudah kirim ya...\"],[1560140513,\"c\",\"bukti transfernya ke email diatas\"],[1560140583,\"s\",\"Baik, terima kasih bapak atas pembayarannya, kami akan segera lakukan pemrosesan ketika pembayaran dari pihak penyedia VA sudah clear\"],[1560140584,\"s\",\"Mungkin apakah ada hal lain yang dapat kami bantu?\"],[1560140602,\"c\",\"cukup bu. terima kasih\"]]'),
